description:
Nicholas Pistone, Giovanni Di Pasquale, Matilde Bardi, &quot;Art and Culture of Ancient Rome&quot; 
English | 2010 | ISBN: 1435835913 | 42 pages | PDF | 39,8 MB

History comes alive within the superbly illustrated pages of 'Ancient Art and Cultures', the newest six volume series from the Rosen Publishing Group. Each of the individual 40-page volumes provides a general overview of the culture addressed includes a glossary, resources for obtaining further information, a thematically appropriate bibliography for further studies, and a 'user friendly' index
